import * as React from 'react';

interface GameHeaderProps {
	showInfo: boolean;
	stage: number;
	time: number;
	score: number;
}

const GameHeader: React.FC<GameHeaderProps> = ({
	showInfo,
	stage,
	time,
	score,
}) => {
	return null;
};

export default GameHeader;
